function Footer(props) {
	return (
		<footer className="site-footer">
			<div className="container">
				<div className="row">
					<div className="col-4 col-sm-2 offset-1">
						<h5>Links</h5>
            <h5>Links</h5>
            <h5>Links</h5>
            
					</div>
				</div>
			</div>
		</footer>
	);
}

export default Footer;
